export const navigation = [
  { 
    name: 'Dashboard', 
    href: '#', 
    current: true,
    subItems: [],
    to: '/dashboard'
  },
  { 
    name: 'Borrower', 
    href: '#', 
    current: false,
    subItems: [
      {
        name: 'Pledge', to: 'borrower/pledge'
      },
      {
        name: 'Borrow', to: 'borrower/borrow'
      },
      {
        name: 'Repay', to: '/borrower/repay'
      }
    ],
    to: '/borrower'
  },
  { 
    name: 'Lender', 
    href: '#', 
    current: false,
    subItems: [
      {
        name: 'Your Profile', href: '#'
      },
      {
        name: 'Settings', href: '#'
      },
      {
        name: 'Sign out', href: '#'
      }
    ],
    to: '/lender'
  },
  { 
    name: 'Liquidity Provider', 
    href: '#', 
    current: false,
    subItems: [
      {
        name: 'Your Profile', href: '#'
      },
      {
        name: 'Settings', href: '#'
      },
      {
        name: 'Sign out', href: '#'
      }
    ],
    to: '/liquidityprovider'
  },
]
